import { tech_stack_box } from "../main.js";


export default ()=>{
    // direct Add Svg using element
    let selectMenu = document.querySelector("[menuBar]");
    selectMenu.innerHTML = menuBar_one_svg;
    let selectRightArrow = document.querySelectorAll("[project_guid_right_arrow]");
    selectRightArrow.forEach(e => {
        e.innerHTML = right_svg;
    })


    // Tech Stack
    class TechStack{
        constructor(svg){
            this.svg = svg;
        }
        execute(){
            let svg = this.svg;


            let mainDiv = document.createElement("div");
            mainDiv.className = "tilt_elm card_skill relative flex-grow-[1] size-[200px] max-lg:size-[150px] bg-black_two_clr flex justify-center items-center rounded-lg cursor-pointer";

            let innerDiv = document.createElement("div");
            innerDiv.className = "absolute left-0 z-20 top-0 h-full w-full";

            let innerSpan = document.createElement("span");
            innerSpan.className = "absolute z-10";
            innerSpan.innerHTML = svg;

            mainDiv.appendChild(innerDiv);
            mainDiv.appendChild(innerSpan);
            tech_stack_box.appendChild(mainDiv);



            // Mouse Move Animation
            function mouseMoveAnimi(){
                innerDiv.addEventListener("mousemove",(e)=>{
                    let x = e.offsetX;
                    let y = e.offsetY; 
                    innerSpan.style.cssText = `
                    scale: 1.5;
                    display: inline-block;
                    position: absolute; 
                    left: ${x - innerSpan.clientWidth / 2}px;
                    top: ${y - innerSpan.clientHeight / 2}px;
                    `;
                });
                innerDiv.addEventListener("mouseout",()=>{
                    innerSpan.style.cssText = `
                    transition: all 0.25s ease-out;
                    left: 50%;
                    top: 50%;
                    transform: translateX(-50%) translateY(-50%);
                    `;
                });
                
            };
            mouseMoveAnimi();



        }
    }
    
    new TechStack(html_svg).execute();
    new TechStack(css_svg).execute();
    new TechStack(js_svg).execute();
    new TechStack(react_svg).execute();
    new TechStack(node_svg).execute();
    new TechStack(express_svg).execute();
    new TechStack(firebase_svg).execute();
    new TechStack(npm_svg).execute();
    new TechStack(git_svg).execute();
    new TechStack(tailwind_svg).execute();
    new TechStack(bootstrap_svg).execute();
    new TechStack(github_svg).execute();
    new TechStack(vite_svg).execute();
    new TechStack(gsap_svg).execute();
}